// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ProfilePage from './ProfilePage'; // Make sure the path is correct
import SearchPage from './SearchPage'; // You'll need to create and implement this component
import ResultsPage from './ResultsPage';
import PastResultsPage from './PastResultsPage';
import Signup from './Signup';
import Login from './Login';
import './App.css'; // Your global styles

const App = () => {
  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/">Profile</Link></li>
          <li><Link to="/search">Search</Link></li>
          <li><Link to="/results">Results</Link></li>
          <li><Link to="/past-results">Past Results</Link></li>
        </ul>
      </nav>
      <Routes>
        <Route path="/search" element={<SearchPage />} />
        <Route path="/result/:id" element={<ResultsPage />} />
        <Route path="/past-results" element={<PastResultsPage />} /> {/* New route for Past Results */}
        <Route path="/" element={<ProfilePage />} />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/Login" element={<Login />} />
      </Routes>
    </Router>
  );
};

export default App;
